SELECT "Telco_1"."PACKAGE_NAME" AS "PACKAGE_NAME",   SUM("Telco_1"."REVENUE_SMS_P1") AS "sum:REVENUE_SMS_P1:ok",   CAST(EXTRACT(YEAR FROM "Telco_1"."RCHRG_AMT_EXP_DATE") AS BIGINT) AS "yr:RCHRG_AMT_EXP_DATE:ok" FROM "Telco_1" GROUP BY "Telco_1"."PACKAGE_NAME",   "yr:RCHRG_AMT_EXP_DATE:ok" ORDER BY "PACKAGE_NAME";
